package unittest;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Component;
import sun.misc.BASE64Decoder;

import java.io.FileNotFoundException;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.OutputStream;

/**
 * @author haze
 * @date created at 2019/9/23 11:01 上午
 */
@Component
public class ApiService {
    @Autowired
    private TestApiService testApiService;

    public String test() {
        String connect = testApiService.connect();
        connect += "test";//test自己的业务
        return connect;
    }

    public static void main(String[] args) throws IOException {
        String imgStr = "data:image/png;base64,";
        convertBase64DataToImage(imgStr.split(",")[1],"/Users/darkhaze/Desktop/pic.png");

    }

    public static void convertBase64DataToImage(String base64ImgData,String filePath) throws IOException {
        BASE64Decoder d = new BASE64Decoder();
        byte[] bs = d.decodeBuffer(base64ImgData);
        FileOutputStream os = new FileOutputStream(filePath);
        os.write(bs);
        os.close();
    }
}
